The Jonas Brothers is an American pop boy band. The band gained its popularity from the Disney Channel children's television network. From Wyckoff, New Jersey, the band consists of three brothers: Kevin Jonas, Joe Jonas, and Nick Jonas. In the summer of 2008, they starred in the Disney Channel Original Movie Camp Rock. The band has released four albums: It's About Time (2006), Jonas Brothers (2007), A Little Bit Longer (2008), and Lines, Vines and Trying Times (2009). In 2008, the group was nominated for the Best New Artist award at the 51st Grammy Awards and won the award for Breakthrough Artist at the American Music Awards.

